// setText â†’ update the value


function TodoApp() {
  const [todos, setTodos] = useState([]);
  const [text, setText] = useState("");

  const addTodo = () => {
    if (text) setTodos([...todos, text]);
    setText("");
  };

  const deleteTodo = (index) => setTodos(todos.filter((_, i) => i !== index));

  return (
    <div>
      <input value={text} onChange={(e) => setText(e.target.value)} placeholder="Add task" />
      <button onClick={addTodo}>Add</button>
      <ul>
        {todos.map((todo, i) => (
          <li key={i}>
            {todo} <button onClick={() => deleteTodo(i)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}






